/www.life.church\/next \\n\\nABOUT LIFE.CHURCH\\nWherever you are in life, you have a purpose. Life.Church wants to help you find your next step. Our hope is that your journey will include joining us at a Life.Church location throughout the United States or globally online at https:\/\/www.live.life.church. Find locations, videos, and more info about us at https:\/\/www.life.church or download the Life.Church app at https:\/\/www.life.church\/app. \\n\\nFIND US ON SOCIAL MEDIA:\\nFacebook: http:\/\/www.facebook.com\/life.church \\nInstagram: http:\/\/www.instagram.com\/life.church \\nTwitter: http:\/\/www.twitter.com\/lifechurch \\n\\nCONNECT WITH PASTOR CRAIG\\nYouTube: https:\/\/www.youtube.com\/channel\/UCIIdiIO-Y20hRW9niR0CA8A \\nFacebook: http:\/\/www.facebook.com\/craiggroeschel \\nInstagram: http:\/\/www.instagram.com\/craiggroeschel \\nTwitter: http:\/\/www.twitter.com\/craiggroeschel \\n\\nAt Life.Church, we also love partnering with local pastors and church leaders around the world who share our passion for leading people to become fully devoted followers of Christ. That’s why we created the Life.Church Open Network, a free network for church leaders to access resources, trainings, apps, and an online community just for them. Visit https:\/\/open.life.church to join and be part of something bigger than yourself.\\n\\n#lifechurch #michaeljr #comedy\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/TKSpqxXyVmk\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLAg54axjHb8qsRQ2GRrrF2aVfgJ8A\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/TKSpqxXyVmk\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBPrpbrzd-sJYINxwL73dgSg-SdjA\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/TKSpqxXyVmk\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLDIoq7NHWyms8mwCyDrT0aK           };
        };

        if (window.loadDataHook) {
          var pageData = window.getPageData();
          window.loadDataHook(pageData.endpoint, pageData.data);
          window.loadDataHook = null;
        }
        setFiller();

    })();
  </script>
